品質保証のBMW純正部品<br>
BMW MINI R53 JOHN COOPER WORKS JCWレザー・カーボン・シフトノブ・MT用<br><br>
シフトノブの前側にブラックレザーを使用しています。<br>
手にしっくりフィットし、常にスムーズなギアチェンジを可能にします。<br>
<br>
※シフトブーツは別売りです。<br>
画像はR56用アルカンタラです。<BR><BR>
■本国オーダー品<br>
■納期：3～4週間程<br><img src="https://image.rakuten.co.jp/bmp/cabinet/04998905/imgrc0068102056.jpg"><br><br>


