品質保証のＢＭＷ純正部品<br>
BMW Performance 6速マニュアルシフトノブです。<br>
アルミ/アルカンタラのコンビ仕上げ。<br>
<br>
適合車種：E39 M5,E36 M3,E46 M3,E85 Z4 の6速ＭＴ車に装着可能です。
<br>
シフトブーツ一体型のお車には、別途ブーツ単品が必要になります。
<br><img src="https://image.rakuten.co.jp/bmp/cabinet/04998905/imgrc0068102056.jpg"><br><br>


