●Bluetoothバージョン2.1仕様。<BR>下位バージョンや上位バージョン(4.1)とも互換性があり、<br>下位/上位バージョンの携帯電話でもご使用になれます。<BR>●Bluetooth対応のスマートフォン/iPhoneの音楽をワイヤレスで受信し、<br>更にワイヤレスでFMラジオに送信し、カーステレオから聴くことができます。<BR>*ワンセグ音声、マルチポイントに対応しておりません。<BR>●microSDカード、USBメモリの音楽データを再生できるプレーヤー機能。<BR>●スマートフォンのφ3.5mmステレオ端子に直接接続して再生できるLINE IN ポート付。<BR>●ハンズフリー通話対応。<BR>●周波数76.0MHz～90.0MHzの範囲から0.1MHz間隔で選択できるフルバンドタイプ。（141ch）<BR>●純正のUSBケーブル等で充電しながら使用できる、USB出力端子付き。<BR>●微弱無線局規定品。<BR><BR>*USBコードは付属していません。必ず純正のUSBコードにて充電してください。<BR>*LINE IN ステレオケーブルは付属していません。<BR>*本製品はモノラル出力となります。左右の音がMIXしてカーオーディオのFMラジオから出力されます。<br><br><br>メーカー：カシムラ<br>品番：KD-179<style type="text/css">
